import React from "react";
import HomeIcon from "@material-ui/icons/Home";
import "./sidebarRow.css";

function SidebarRow({ title }) {
  return (
    <div className=".">
      <HomeIcon />
      <h2> {title}</h2>
    </div>
  );
}

export default SidebarRow;
